    WARNING! Make sure that you match all Quasar related

    <link href="https://fonts.googleapis.com/css?family=Roboto:100,300,400,500,700,900|Material+Icons" rel="stylesheet" type="text/css">

      <div id="q-app">
       <!-- <q-btn color="primary" icon="warning" label="Notify" @click="notify" class="q-ma-md"></q-btn> -->
  <div id="q-page-container" class="flex flex-center" style="height:100%;min-height:100vh;background-image:url(https://raw.githubusercontent.com/aa32555/efuzy.com/staging/public/imgs/bg1.jpg);background-size: cover;">




    

      <div class="q-pa-md row justify-center">
    <div style="width: 100%; style="height:100%;min-height:50vh;>
      <q-chat-message
        name="me"
        avatar="https://avatars.githubusercontent.com/u/155005073?v=4"
        stamp="7 minutes ago"
        sent
        text-color="white"
        bg-color="primary"
      >
        <div>
          Hey there!
        </div>

        <div>
          Have you seen Quasar?
          <img src="https://cdn.quasar.dev/img/discord-omq.png" class="my-emoticon">
        </div>
      </q-chat-message>

      <q-chat-message
        name="Jane"
        avatar="https://cdn.quasar.dev/img/avatar5.jpg"
        bg-color="amber"
      >
        <q-spinner-dots size="2rem" />
      </q-chat-message>
    </div>
  </div>


    

    


    
      
      </div>

    <script>
    window.quasarConfig = {
      brand: {
        primary: '#e46262',
      },
      notify: {}, 
      loading: {},
      loadingBar: {},
    }
    </script>
    <script src="https://cdn.jsdelivr.net/npm/quasar@1.22.10/dist/quasar.ie.polyfills.umd.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/vue@^2.0.0/dist/vue.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/quasar@1.22.10/dist/quasar.umd.modern.min.js"></script>
    <script>
            new Vue({
              el: '#q-app',
              data: function () {
                return {
                  version: Quasar.version
                }
              },
              mounted: function(){
                this.$q.dark.set(true)
              },
              methods: {
              	notify: function () {
                  this.$q.notify('Running on Quasar v' + this.$q.version)
                }
            	}
            })
    </script>
  {{vara}}
  </body>
</html>
